export function getlAllWords():string[] {
  const str = POSSIBLE_MEDUYAKOT;
  const chunk_size = 5;
    const chunk_inds = Array.from(Array(str.length / chunk_size).keys());
    return chunk_inds.map(function(i) {return str.slice(i * chunk_size, (i + 1) * chunk_size)});
}
export function getTodayWord():string{
    const now = new Date()
  const start = new Date(2022, 1, 5)
  const diff = Number(now) - Number(start)
  let day = Math.floor(diff / (1000 * 60 * 60 * 24));
  const allWords = getlAllWords();
  while (day > allWords.length) {
    day -= allWords.length
  }
  return allWords[day]
}

